let express = require('express');
let router = express.Router();

router.get('/', function (req, res) {
  res.render('landing');
});

router.get('/campgrounds', function (req, res) {
  let campgrounds = [
    { name: 'campground1', image: 'data:image/jpeg;base64,' },
    { name: 'campground2', image: 'data:image/jpeg;base64,' },
    { name: 'campground3', image: 'data:image/jpeg;base64,' },
    { name: 'campground4', image: 'data:image/jpeg;base64,' },
    { name: 'campground5', image: 'data:image/jpeg;base64,' },
  ]

  res.render('campgrounds', { campgrounds });

});

module.exports = router;